import React, { useEffect } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import "bootstrap/dist/css/bootstrap.min.css";
import Avehicle from "./components/pages/Avehicle"

function App() {
  useEffect(() => {
    store.dispatch(loadUser());
  }, []);
  
  return (

    <div className="App">
    <Router>
      
    
      <Route path="/addvehicle" component={Avehicle} />
    

    </Router>
    </div>
  );
}

export default App;
